import React from 'react';

const AboutUs = () => {
  return (
    <div className="about-us">
      <h2>About Us</h2>
      <p>Welcome to the Course Management System. We are dedicated to providing the best educational experience for our students. Our platform helps manage courses, professors, and students efficiently.</p>
    </div>
  );
}

export default AboutUs;
